* {
    box-sizing: border-box;
}

.main-container {
    display: flex;
    width: 90%;
    margin: auto;
    justify-content: space-around;
    margin-top: 120px;
}

.text-container {
    width: 300px;
    height: 300px;
    background-color: #800080;
    color: #FFFFFF;
    padding: 10px;
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;
    border-radius: 50%;
}

.text-container:last-child {
    background-color: #484893;
    border-radius: 12%;
}
